import moment from "moment";

export class InfoBpmModel{    
    constructor(instanceId=0,transactId=0,processId=0,activityId=0,personId=0,personName="") {
      this.instanceId=0;
      this.transactId=0;
      this.processId=0;
      this.activityId=0;
      this.personId=0;
      this.personName="";
    }
  }
